import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Events.css';

class Events extends Component {

    render() {
        return (
            <div>
                This is EVENT PAGE.
                <a target="_blank" href="https://calendar.google.com/event?action=TEMPLATE&amp;tmeid=MmUxYzZjMG1uaTIzYzdibWY4YWJ2Y203MGcgcGFuZGV5eWFzaDA0QG0&amp;tmsrc=pandeyyash04%40gmail.com"><img border="0" src="https://www.google.com/calendar/images/ext/gc_button1_en.gif" /></a>
            </div>
        );
    }
}

export default Events;
